import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import axios from "axios";
import "./App.css";
import MovieCarousel from "./MovieCarousel";
import Footer from "./Footer";
import MovieList from "./MovieList"; // Nuevo componente para la lista de películas
import MovieDetail from "./MovieDetail"; // Nuevo componente para los detalles de la película

/*CSS*/
import "./MovieList.css";
import "./MovieDetail.css";
import "./Logocss.css";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./MovieCarousel.css";

function App() {
    const API_URL = "https://api.themoviedb.org/3";
    const API_KEY = "674684d28cd5c404ad1bf06cd1a5d482";
    const IMAGE_PATH = "https://image.tmdb.org/t/p/original";
    const URL_IMAGE = "https://image.tmdb.org/t/p/original";

    const [movies, setMovies] = useState([]);
    const [searchKey, setSearchKey] = useState("");
    const [category, setCategory] = useState("");
    const [searchType, setSearchType] = useState("");

    const fetchMovies = async (searchKey, category, searchType, fromDate, toDate) => {
        const type = searchKey ? "search" : "discover";
        let params = {
            api_key: API_KEY,
            query: searchKey,
            with_genres: category ? category : undefined,
        };

        if (searchType) {
            params = { ...params, ...{ sort_by: searchType } };
        }

        if (fromDate && toDate) {
            params["primary_release_date.gte"] = fromDate;
            params["primary_release_date.lte"] = toDate;
        }

        const { data: { results } } = await axios.get(`${API_URL}/${type}/movie`, {
            params: params,
        });

        const filteredMovies = results.filter(
            (movie) =>
                !movie.title.toLowerCase().includes("tiburon") &&
                movie.title !== "No Way Up" &&
                movie.title !== "Jaws" &&
                movie.title !== "Sharknado" &&
                movie.title !== "Deep Blue Sea" &&
                movie.title !== "The Meg" &&
                movie.title !== "Shark" &&
                movie.title !== "Under Paris"
        );

        setMovies(filteredMovies);
    };

    const searchMovies = (e) => {
        e.preventDefault();
        fetchMovies(searchKey, category, searchType);
    };

    const goToHomePage = () => {
        window.location.href = "/";
    };

    const handleCategoryChange = (category) => {
        setCategory(category);
        setSearchType("");
        fetchMovies(searchKey, category, searchType);
    };

    useEffect(() => {
        fetchMovies("", "", "");
    }, []);

    return (
        <Router>
            <div className="App">
                <header className="menu">
                    <div className="logo-and-search">
                        <button className="logo" onClick={goToHomePage}>
                            <img src="http://imgfz.com/i/5hQ3ZSJ.png" alt="Logo" />
                        </button>
                        <form className="container mb-4" onSubmit={searchMovies}>
                            <input
                                type="text"
                                placeholder="search"
                                onChange={(e) => setSearchKey(e.target.value)}
                            />
                            <button className="btn btn-primary" onClick={searchMovies}>
                                Search
                            </button>
                        </form>
                        <div className="category-buttons">
                            <select value={category} onChange={(e) => handleCategoryChange(e.target.value)}>
                                <option value="">All</option>
                                {Object.entries(categories).map(([id, name]) => (
                                    <option key={id} value={id}>
                                        {name}
                                    </option>
                                ))}
                            </select>
                        </div>
                    </div>
                </header>
                <Routes>
                    <Route
                        path="/"
                        element={<MovieList movies={movies} setMovies={setMovies} fetchMovies={fetchMovies} />}
                    />
                    <Route
                        path="/movie/:id"
                        element={<MovieDetail API_URL={API_URL} API_KEY={API_KEY} IMAGE_PATH={IMAGE_PATH} />}
                    />
                </Routes>
                <Footer />
            </div>
        </Router>
    );
}

export default App;
